Household_AUM_Rank_1.query:
q = load "${App.Datasets.FscDemoAccount.FullyQualifiedName}";
q = filter q by 'RECORDTYPENAME' == "Household";
result = group q by 'HOUSEHOLDCOMPUTED';
result = foreach result generate q.'HOUSEHOLDCOMPUTED' as 'HOUSEHOLDCOMPUTED', avg(q.'YEARSSINCECLIENT') as 'avg_Years_Since_Client', avg(q.'WALLETSHARE') as 'avg_FinServ__WalletShare__c', sum(q.'AUM') as 'sum_AUM';
result = group result by 'HOUSEHOLDCOMPUTED';
result = foreach result generate 'HOUSEHOLDCOMPUTED' as 'HOUSEHOLDCOMPUTED', sum(avg_Years_Since_Client) as 'avg_Years Since Client', sum(avg_FinServ__WalletShare__c) as 'avg_Wallet Share (%)', sum(sum_AUM) as 'sum_AUM', dense_rank() over([..] partition by all order by sum(sum_AUM) desc) as 'rank_AUM';
result = order result by ('sum_AUM' desc);
result = filter result by 'rank_AUM' <= {{cell(Top_N_1.selection,0,"value").asObject()}};

Household_Filter_1.query:
q = load "${App.Datasets.FscDemoAccount.FullyQualifiedName}";
q = filter q by 'RECORDTYPENAME' == "Household";
q = group q by 'HOUSEHOLDCOMPUTED';
q = foreach q generate 'HOUSEHOLDCOMPUTED' as 'Household_computed', count() as 'count';
q = order q by 'Household_computed' asc;
q = limit q 2000;

AUM_Bucket_1.query:
q = load "${App.Datasets.FscDemoAccount.FullyQualifiedName}";
q = filter q by 'RECORDTYPENAME' == "Household";
result = group q by 'AUMBUCKET';
result = foreach result generate q.'AUMBUCKET' as 'AUMBucket', count(q) as 'count';
result = order result by ('AUMBucket' asc);
result = limit result 2000;

Household_Size_1.query:
q = load "${App.Datasets.FscDemoAccount.FullyQualifiedName}";
q = filter q by 'RECORDTYPENAME' == "Household";
q = group q by 'HOUSEHOLDSIZETEXT';
q = foreach q generate 'HOUSEHOLDSIZETEXT' as 'HouseholdSizeText', min('HOUSEHOLDSIZE') as 'min_Household.HouseholdSize', count() as 'count';
q = order q by 'min_Household.HouseholdSize' asc;
q = limit q 2000;

Client_List_1.query:
q = load "${App.Datasets.FscDemoAccount.FullyQualifiedName}";
--q = filter q by 'HouseholdRollUpFlag' == 1;
q = filter q by 'ROLLUPHOUSEHOLDNAME' in {{column(Household_Filter_1.result, ["Household_computed"]).asString()}};
q = foreach q generate 'ROLLUPHOUSEHOLDNAME' as 'ROLLUPHOUSEHOLDNAME', 'NAME' as 'NAME', 'AUM' as 'AUM', 'AGEBUCKET' as 'AGEBUCKET', 'CLIENTCATEGORYCUSTOM' as 'CLIENTCATEGORYCUSTOM', 'DAYSSINCELASTINTERACTION' as 'DAYSSINCELASTINTERACTION', 'LASTINTERACTION' as 'LASTINTERACTION', 'NETWORTH' as 'NETWORTH', 'REVIEWFREQUENCY' as 'REVIEWFREQUENCY', 'RISKTOLERANCE' as 'RISKTOLERANCE', 'SERVICEMODEL' as 'SERVICEMODEL' ;
q = limit q 100;
